import axios from "axios";

export const fetchData = (httpMethod, url, data) => {
  if (httpMethod === 'get') {
    axios[httpMethod](url).then(response => {
      console.log(response.data);
    })
    .catch(error => {
      console.error(error);
    });
  } else {
    axios[httpMethod](url, data).then(response => {
      console.log(response.data);
    })
    .catch(error => {
      console.error(error);
    });
  }
}
